// src/pages/Welcome.js
import React from "react";
import { Link } from "react-router-dom";
import "../styles/Welcome.css"; // Import the Welcome page styles

const Welcome = () => {
  return (
    <div className="welcome-container">
      <div className="welcome-content">
        <h1 className="welcome-title">Welcome to Fitness Assistant</h1>
        <p className="welcome-description">
          Achieve your fitness goals with personalized assistance. Track your progress, manage your expenses, and more.
        </p>
        <Link to="/login" className="start-btn">
          Get Started
        </Link>
      </div>
      <div className="welcome-image">
        {/* Optional image (you can replace this with a relevant image) */}
        <img src="/images/fitness.jpg" alt="Fitness" className="fitness-image" />
      </div>
    </div>
  );
};

export default Welcome;
